  	<View style={{flex: 1, justifyContent: 'center',alignItems: 'center'}}>


    <div style={{border: '1px solid rgba(127, 0, 0, 0.4)'}}>
      <h2 style={{ color: 'rgba(150, 20, 160, 0.7)'}}>{title}</h2>
      <h5><br /><i>  Written by <b>{author}</b></i></h5>
      <div>{content}</div>
      <h4>    Created in {dateCreated}</h4>
      <div>
      <input type="checkbox" />
    </div>
	  <h4>    Completed in {dateComleted}</h4>


    </div>
    </View>
  );
}
